import React from 'react';
import './home.css';

const Home = () => {
    return (
        <View>
            <Text style={{fontFamily: 'Lobster-Regular'}}>
               Hello,world!
            </Text>
            <Ionic name="play" style={{fontSize: 20}} />
        </View>
    )
}

export default Home;
